import Image from './Image'
import useFetch from './useFetch';
import apiKey from '../config';

let api = apiKey;

const ImageList = ({ error, isPending }) => {

  const { data: images } = useFetch(`https://www.flickr.com/services/rest/?method=flickr.photos.search&api_key=${api}&tags=elvis&per_page=24&format=json&nojsoncallback=1`)

  return ( 

    <div className="photo-container">
      <h2>Results</h2>
      { error && <div>{ error }</div> }
      { isPending && <div>Loading...</div> }
      { images && <ImageList /> }
      { images && images.map((image) => (
        <ul>
          <Image  
            url={`https://farm${image.farm}.staticflickr.com/${image.server}/${image.id}_${image.secret}.jpg`}
            key={image.id}
          />
        </ul>
      ))}

  </div>
   );
}

export default ImageList;
